(7, 'CS001', 'Spartan Karbon Skin', 'Casco in carbonio per alte prestazioni', 1, '- Omologazione ECE 22.06\r\n- Casco integrale in carbonio (RSC) uso Roadster\r\n- Calotta in fibre di vetro multi-assiali in 2 taglie\r\n- Fibbia doppia D\r\n- Peso di soli 1485 grammi\r\n- Visiera ultraresistente con sistema di blocco \"4 punti di aggancio\" e ultima posizione \"soffio d\'aria\"\r\n- Visiera VZ300 di classe ottica 1 senza alcuna distorsione\r\n- Visiera parasole interna omologata UV 380 la quale offre un\'ergonomia ottimizzata\r\n- Compatibile SharktoothÂ®\r\n- Pinlock 120 Max VisionÂ® fornito insieme al casco\r\n- SharktoothÂ® Prime\r\n- Alveotech Tessuto con omologazione SanitizedÂ® ad efficacia antimicrobica, anti-odore e antisudore\r\n- Le imbottiture di sostegno garantiscono comfort ed un eccezionale isolamento acustico\r\n- Sottogola anti-turbolenza amovibile\r\n- Ventilazione estrema: 3 ingressi d\'aria/4 estrattori d\'aria\r\n- Easy Fit con scanalature per gli occhiali', 'Il casco integrale Spartan RS Carbon Skin Ã¨ capace di superare brillantemente le richieste della nuova norma ECE 22.06 ed Ã¨ il primo casco da moto integrale SHARK della nuova generazione.\r\nPensato e progettato per eliminare la resistenza aerodinamica e ridurre al minimo l\'effetto \"buffeting\" Ã¨ perfetto per un uso roadster in pista e nei giri in moto su qualunque distanza.\r\nLa combinazione tra la calotta esterna composita multiassiale e l\'EPS multi-densitÃ  assicura il piÃ¹ alto livello di protezione e supera gli standard della nuova normativa\r\nLe sue caratteristiche principali sono il peso di soli 1485 grammi, una qualitÃ  ottica eccezionale grazie alla visiera ultra-efficace VZ 300 inclusa nella confezione, il profilo estremamente aerodinamico che ottimizza la ventilazione e l\'eccezionale isolamento acustico.', NULL, 14, 2),
(8, 'CS002', 'Bogotto GP PRO', 'Casco in carbonio economico per alte velocita', 1, 'Guanti sportivi in pelle\r\nForma ergonomica precurva\r\nProtezioni per nocche in plastica dura\r\ncursore del palmo in plastica\r\ndoppi strati di materiale in aree stressate\r\nPatch di presa sul palmo della mano\r\nmorbida fodera interna\r\npolsino corto con chiusura Velcro', 'Livello di protezione 1 (EN 13594:2015)', NULL, 14, 2),
(12, '14093', 'Guanti antiscivolo', 'Guanto lungo foderato, rinforzi antiscivolo sul palmo, membrana impermeabile traspirante 100%', 1, 'Stile: Urban\r\nStagione: Inverno\r\nEAN13', 'Nessuna informazione aggiuntiva', NULL, 16, 15),
(17, '78861', 'SMART JACKET LS SPORT', 'Smart Jacket LS Sport Ã¨ la giacca da moto ventilata e traspirante che integra il sistema airbag Dainese D-airÂ®, la massima evoluzione della protezione da moto in un capo stradale.\r\n\r\nLa costruzione in materiali resistenti, stretch e anti-abrasione, e le protezioni Pro-Armor livello 2 tipo B su gomiti e spalle conferiscono il massimo livello di protezione e copertura, con la massima comoditÃ  e libertÃ  di movimento.\r\n\r\nSmart Jacket LS Sport unisce la versatilitÃ  e le performance di una giacca sportiva Dainese all\'intelligenza e protezione superiore del sistema airbag Dainese D-airÂ®, che riconosce autonomamente le situazioni di pericolo per il motociclista e si attiva per proteggere schiena e torace con lo Shield, il sacco airbag con tecnologia brevettata in microfilamenti. Una soluzione tecnologica esclusiva che permette un gonfiaggio e una protezione omogenea su tutta lâarea di copertura, senza la necessitÃ  di protettori rigidi.\r\n\r\nIl massimo comfort termico anche nelle giornate piÃ¹ calde Ã¨ garantito da ampi pannelli in mesh per la ventilazione della zona centrale. La fascia lombare regolabile interna consente di regolare con precisione il fit della giacca in vita.', 1, 'CARATTERISTICHE\r\n2 tasche esterne\r\n\r\nInserti riflettenti\r\n\r\nERGONOMIA\r\nStruttura ventilata\r\n\r\nCARATTERISTICHE TECNICHE GENERALI\r\nCintura regolabile\r\n\r\nChiusura con zip sul polso\r\n\r\nMATERIALI PRINCIPALI\r\nTessuto Mugello', 'PERFORMANCE SHOCK\r\nProtezione per la spina dorsale Liv. 1: testata secondo la norma 1621.4\r\n\r\nProtezione toracica Liv. 2: testata secondo la norma 1621.4\r\n\r\nSistema airbag D-airÂ®\r\n\r\nProtettori Pro-Armor certificati secondo EN 1621.1 Livello 2 Tipo B sui gomiti\r\n\r\nProtettori Pro-Armor certificati secondo EN 1621.1 Livello 2 Tipo B sulle spalle', NULL, 20, 16),
(18, '76449', 'TORQUE 3 OUT BOOTS', 'Questo stivale racing Ã¨ realizzato in microfibra e tessuto D-Stoneâ¢ con inserti in TPU ad alta aderenza.\r\nComoditÃ  e sicurezza sono assicurate dagli slider in magnesio sostituibili, dal nylon protettivo su scafo, tacco e punta e dallâesclusivo sistema D-Axial in TPU che previene la torsione del piede.\r\n\r\nUn vero campione di leggerezza e performance, grazie alla fascia interna di ritenzione, al sistema di allacciatura rapida e a quello di canalizzazione dellâaria, oltre agli inserti in magnesio sul lato esterno e sul tallone e ai giunti flessibili che estendono il comfort anche una volta scesi dalla moto. Sicurezza e confidenza per esprimersi al massimo su ogni circuito.', 1, 'PERFORMANCE SHOCK\r\nStivali certificati secondo la norma CE - Cat. II - EN 13634\r\n\r\nSistema D-Axial in TPU\r\n\r\nInserti in magnesio sul lato esterno e sul tallone\r\n\r\nTallone in nylon\r\n\r\nGuscio interno protettivo in nylon\r\n\r\nDita in nylon rinforzato\r\n\r\nSlider sostituibile in magnesio (1999948 Kit slider in magnesio per stivali, 1999885 Kit slider in acciaio inox per stivali, 1999954 Kit slider in plastica per stivali 16)\r\n\r\nFascia interna di tenuta\r\n\r\nInserto in TPU sul lato posteriore interno\r\n\r\nTEMPERATURA\r\nSistema di canalizzazione dell\'aria\r\n\r\nFodera ad intercapedine d\'aria in jersey doppio', 'CARATTERISTICHE\r\nProtezione nella zona del pedale cambio\r\n\r\nInserti in TPU ad elevata aderenza\r\n\r\nChiave a brugola fornita\r\n\r\nERGONOMIA\r\nChiusura con zip sul retro\r\n\r\nArticolazioni flessibili per il massimo comfort durante la camminata\r\n\r\nSistema di allacciatura rapida\r\n\r\nMATERIALI PRINCIPALI\r\nTessuto D-Stoneâ¢\r\n\r\nSuola in gomma\r\n\r\nTomaia in microfibra', NULL, 15, 45),
(19, '12499', 'DRAKE 2 AIR ABSÃLUTESHELL - PANTALONI MOTO ESTIVI IMPERMEABILI UOMO', 'Pensati per la guida sportiva su strada, Drake 2 Air AbsÃ¸luteshellâ¢ sono i pantaloni da moto ideali per le uscite giornaliere in estate e mezza stagione.\r\n\r\nPerfetto completamento per la giacca Super Rider 2, alla quale si uniscono comodamente con il sistema jacket-pants fastening system, questo pantalone Ã¨ estremamente versatile in quanto Ã¨ realizzato con costruzione modulare, garantendo allo stesso tempo impermeabilitÃ  grazie alla fodera impermeabile rimovibile AbsÃ¸luteshellâ¢ e ventilazione grazie alla membrana traspirante in mesh.\r\n\r\nGrande attenzione Ã¨ data alla ergonomia, con lâintroduzione di ampi inserti in tessuto elasticizzato Mugello e una rivista vestibilitÃ  del cavallo, che incrementano i livelli di leggerezza e mobilitÃ  in sella.\r\n\r\nQuesto modello Ã¨ certificato EN 17092 classe A ed Ã¨ dotato di protettori removibili compositi certificati sulle ginocchia e di tasche sui fianchi per inserire i protettori morbidi Pro-Shape 2.0.', 1, 'MATERIALI PRINCIPALI\r\nMembrana rimovibile ABSÃLUTESHELLâ¢\r\n\r\nInserti in tessuto mesh\r\n\r\nTessuto Mugello\r\n\r\nPERFORMANCE SHOCK\r\nProtettori compositi certificati secondo la norma EN 1621.1 sulle ginocchia\r\n\r\nTasche per protettori dei fianchi Pro-Shape 2.0 certificate secondo EN 1621.1\r\n\r\nTEMPERATURA\r\nFodera in mesh traspirante', 'CARATTERISTICHE\r\nCostruzione del polpaccio con 1 zip\r\n\r\n2 tasche\r\n\r\nCapo da moto certificato secondo la norma EN 17092 A\r\n\r\nERGONOMIA\r\nSistema di accoppiamento tra giacca e pantaloni\r\n\r\nInserti microelasticizzati\r\n\r\nRegolazione del girovita', NULL, 18, 46),
(20, '64731', 'Tuta Moto In Pelle Berik 2.0 Intera Ls1-181327-BK Monza 2 Monza Nero Rosso Bianco', 'Tuta Moto In Pelle Berik 2.0 Intera Ls1-181327-BK Monza 2 Monza Nero Rosso Bianco', 1, 'Scheda Tecnica:\r\n\r\n1.1-1.3 mm premium pieno fiore in pelle di mucca\r\nTessuto elasticizzato su gomito, inguine & retro ginocchio per fornire flessibilitÃ  & comfort\r\nFodera in rete fissa sul polpaccio per offrire il migliore comfort\r\nProtezioni interne alle spalle, gomiti e ginocchia omologate CE\r\nGobba aerodinamica\r\nInesrti Pelle traforata per migliorare la ventilazione\r\nPannelli elasticizzati in pelle alle ginocchia, retro, retro giromanica per movimento confortevole & flessibile\r\nDoppio strato in pelle di rinforzo al gomito, spalla e sedile\r\nVelcro all\'interno del pannello frontale per facilitare un protettore petto se necessario\r\nCinghia da polso il bracciale per offrire la migliore comoditÃ \r\nSlider non compresi, acquistabili a parte', NULL, NULL, 17, 11),
(21, '34667', 'MX1 KNEE GUARD', 'La collezione Dainese MX nasce per proteggere i piloti di offroad negli ambienti piÃ¹ estremi. Ã sviluppata sui campi di gara, per offrire la massima sicurezza e la libertÃ  di movimento necessaria ad esprimersi al meglio, in ogni condizione.\r\nMX1 Knee Guard Ã¨ la ginocchiera per la pratica dell\'offroad. Grazie alla sua struttura snodata con tre pannelli protettivi separati, garantisce la massima libertÃ  di movimento. I pannelli ventilati e la calza realizzata in tessuto leggero e traspirante offrono il massimo comfort termico in tutte le condizioni.\r\nLa stabilitÃ  sulla coscia e sul polpaccio Ã¨ garantita dagli inserti in silicone su entrambi gli elastici. Per la perfetta vestibilitÃ  sono presenti due fasce in velcro regolabili, una nella zona della coscia e una nella zona del polpaccio.\r\nMX1 Knee Guard Ã¨ un protettore certificato.', 1, 'PERFORMANCE SHOCK\r\nProtettori per le ginocchia certificati secondo EN1621-1 Livello 1', 'ERGONOMIA\r\nRegolazioni con gancio e passante\r\n\r\nStruttura superiore antiscivolo\r\n\r\nStruttura ventilata', NULL, 19, 39);

